import React, { useState }from 'react';
import { Row, Col, Container, Form, Button } from "react-bootstrap";

function Signup() {

  const [first_name, setFirstName] = useState("");
  const [last_name, setLastName] = useState("");
  const [company, setCompany] = useState("");
  const [email, setEmail] = useState("");
  const [phone_number, setPhoneNumber] = useState("");
  const [password, setPassword] = useState("");
  const [confirm_password, setConfirmPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");
  const [successMessage, setSuccessMessage] = useState("");
  const [errorDisplayed, setErrorDisplayed] = useState(false);
  const [successDisplayed, setSuccessDisplayed] = useState(false);

  function emailValidation() {
    const emailRegex =  /[a-zA-Z0-9.!#$%&'*+/=?^_`{|}~-]@(gmail|hotmail|outlook|yahoo)\.com\b$/g;
    return emailRegex.test(email);
  } 

  const SignUpFormValidation = () => {
    let formValid = true;

    if(!first_name || !last_name || !company || !email || !phone_number || !password || !confirm_password){
      setErrorMessage("All fields must be filled in");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(!emailValidation) {
      setErrorMessage("The email is not valid");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(first_name.length < 2){
      setErrorMessage("Your first name must be longer than 2 characters");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(last_name.length < 2){
      setErrorMessage("Your last name must be longer than 2 characters");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(phone_number.length !== 8){
      setErrorMessage("You must provide a danish phone number");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(password.length < 8){
      setErrorMessage("Your password is not strong enough");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(phone_number.length !== 8){
      setErrorMessage("You must provide a danish phone number");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }

    if(confirm_password.length !== password.length){
      setErrorMessage("You must provide a danish phone number");
      setErrorDisplayed(true);
      formValid = false;
    } else {
      setErrorDisplayed(false);
    }


  }
  return (
    <Container fluid>
    <Row>
      <Col sm={12} md={12} lg={5} style={{ backgroundColor: "#F9E95D", height: "130vh" }}>
      </Col>

      <Col sm={12} md={12} lg={6} style={{fontFamily: "primary-font"}}>
        <div className="text" style={{textAlign: "center", marginTop: "2rem"}}>
        <h1 className="mb-1 p-4" style={{fontSize: 55}}>Sign Up</h1>
        <p className="mb-4" style={{fontSize: 30}}>Introduce your creditentials in order to register an account</p>
        </div>

      
        <Form className="py-4 px-5 d-flex align-items-center flex-column" style={{fontSize: 25}}>
        <Form.Group className="mb-3">
            <Form.Control type="first_name" placeholder="First Name" style={{height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }} />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Control type="last_name" placeholder="Last Name" style={{ height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }}/>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Control type="company" placeholder="Company" style={{ height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }}/>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Control type="email" placeholder="Email" style={{height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }} />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Control type="phone_number" placeholder="Phone Number" style={{ height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }}/>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Control type="password" placeholder="Password" style={{ height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }}/>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Control type="confirm_password" placeholder="Confirm Password" style={{ height: "2.7rem", marginBottom: "1rem", padding: "1.5rem", fontSize: 25, borderRadius: 20, borderBottom: "3px solid grey" }}/>
          </Form.Group> 

          <Button className="mt-3 mb-5 px-4" style={{fontSize: 25, borderBottom: "4px solid black", borderRadius: 20, backgroundColor: "#7F7EC7"}}>Register</Button>

          <p>
            Already have an account? Log in <a href="/login" style={{textDecoration: "none", color: "black", fontWeight: "bold"}}>here!</a>
          </p>
        </Form>
      </Col>
    </Row>
  </Container>
  )
}

export default Signup
